import Button from './Button'; // Assuming you have a Button component

import './Hdr.css';

const Hdr = ({ onAddUserClick }) => {
  const imageUrl = 'https://cdn.discordapp.com/attachments/341337244927524873/1176193564905050142/DSSS.png?ex=656dfa9e&is=655b859e&hm=9d5141bad69b979a750d10698e60277f8045ea8a016352e1695d5181b00a1052&';

  const hdrStyle = {
    position: 'relative',
    overflow: 'hidden',
  };

  const imageStyle = {
    position: 'absolute',
    top: 0,
    left: 0,
    width: '100%',
    height: '100%',
    objectFit: 'cover',
    zIndex: -1,
  };

  const signInButtonStyle = {
    position: 'absolute',
    top: 0,
    right: 0,
    padding: '20px', // Adjust the padding as needed
  };

  return (
    <div className="hdr" style={hdrStyle}>
      <img src={imageUrl} alt="Background" style={imageStyle} />
      <h1>cinema review</h1>
      <div className="button-container">
        <Button onClick={onAddUserClick}>Write a review!</Button>
        <Button onClick={on} style={signInButtonStyle}>
          Sign In
        </Button>
      </div>
    </div>
  );
};

export default Hdr;
